settings\u0004Note: To disable a context:
Hinweis: Um einen Kontextmenüeintrag zu deaktivieren,
kopieren Sie ihn in die Benutzereinstellungen und fügen Sie den Schlüssel
"deaktiviert" hinzu. Das folgende Beispiel deaktiviert die Option "Download" für Dateien:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

Beschreibung des Kontextmenüs:

settings\u0004Overrides for where to sho:
Überschreibt, wo die Seitenleiste angezeigt werden soll,
z.B. {"jp-debugger-sidebar": "left"}
Sie können dies auch ändern, indem Sie mit der rechten Maustaste auf die Seitenleistensymbole klicken.
